import React, {Component} from 'react'

class Homies extends React.Component{
    constructor(){
        super()
        this.state = {}
            homies: ["John", "Jeremy", "Carlos", 
            "Emmanuel", "Francis", "Marlon"]
    }

    render(){
        return(
            <div>
               <h2>My Homies!</h2> 
               <ul>
                    {this.state.homies.map((homie)=>{
                        //some function to call on each element
                        return <li>(homie)</li>
                    })}
               </ul>
            </div>
        )
    }

}
    export default Homies;
